import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import "./SignIn/SignIn.css";
import "./pages.css";
import NavBar from "./navbar/NavBar";
import space from './space.jpg';
import cover from './cover.PNG';
import two from './two.PNG';
import three from './three.PNG';
import four from './four.PNG';
//import five from './five.PNG'; 
//import six from './six.PNG';
import seven from './seven.PNG';
import sevens from './sevens.PNG';
import eight from './eight.PNG';
import nine from './nine.PNG';

class Home extends Component {
  constructor(props) {
    super();
    this.state = {};
  }

changeRoute = (newRoute) => {
  this.props.changeRoute(newRoute);
}
loadUser = (data) =>{
  this.props.loadUser(data);
}

  render() {
    return (
      <div>
        <NavBar changeRoute={this.changeRoute} />

     
        <div className="tc">
          <br />
          <br />
          <br />
          <h1 className="tc white i f1 font">The Calculator </h1>
          <br />
          <br />
          <Container>
            <Row>
           
              <Col className="tc f3 solidBR">
                    <iframe height="800px" width="100%" src="https://repl.it/@Schmidt9/all?lite=true" scrolling="no" frameborder="no" allowtransparency="true" allowfullscreen="true" sandbox="allow-forms allow-pointer-lock allow-popups allow-same-origin allow-scripts allow-modals"></iframe>

               <hr />
              </Col>
              </Row>

              <br/>
              <br/>
              <br/>
              <br/>

              

          </Container>
          <br/>
          <br/>
        </div>
        </div>
    );
  }
}

export default Home;
